sys_script_include.script:
var AlreadyBooked = Class.create();
AlreadyBooked.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    sendBookings: function() {
        var date = this.getParameter('sysparm_date');
		var room = this.getParameter('sysparm_room')
        var gr = new GlideRecord('x_950986_work_hub_booking');
        gr.addQuery('room_name.room_name', room);
		gr.addQuery('u_date', date);
		gs.info(date);
        gr.query();
		var array = []
        while (gr.next()) {
			array.push(gr.start + " to " + gr.end)
        }
		return JSON.stringify(array)
    },

    type: 'AlreadyBooked'
});
